import React from 'react';
import Head from 'next/head';
import { Form, Input, Checkbox, Button } from 'antd';
import AppLayout from '../components/AppLayout';

const Signup = () => {
    const onSubmit = () => {};

    const onChangeId = () => {};

    const onChangeNick = () => {};

    const onChangePassword = () => {};

    const onChangePasswordChk = () => {};

    const onChangeTerm = () => {};

    return (
        <div>
        <Head>
            <title>Node Bird</title>
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.25.3/antd.css" />
        </Head>
        <AppLayout>
            <Form onSubmit={onSubmit} style={{padding: 10}}>
                <div>
                    <label htmlFor="user-id">ID</label>
                    <br />
                    <Input name="user-id" required onChange={onChangeId} />
                </div>
                <div>
                    <label htmlFor="user-nick">NickName</label>
                    <br />
                    <Input name="user-nick" required onChange={onChangeNick} />
                </div>
                <div>
                    <label htmlFor="user-pass">Password</label>
                    <br />
                    <Input name="user-pass" type="password" required onChange={onChangePassword} />
                </div>
                <div>
                    <label htmlFor="user-pass-chk">Password Check</label>
                    <br />
                    <Input name="user-pass-chk" required onChange={onChangePasswordChk} />
                </div>
                <div>
                    <Checkbox name="user-term" onChange={onChangeTerm}>I agree that term!</Checkbox>
                </div>
                <div>
                    <Button type="primary" htmlType="submit">Sign up</Button>
                </div>
            </Form>
        </AppLayout>
        </div>  
    );
};

export default Signup;
